import React, { useState } from "react";
import data from "../data/data";
import {
  TabContent,
  TabPane,
  Nav,
  NavItem,
  NavLink,
  Card,
  Button,
  CardTitle,
  CardText,
  Row,
  Col,
} from "reactstrap";

const MyTabPanel = (props) => {
  const [activeTab, setActiveTab] = useState("1");

  const toggle = (tab) => {
    if (activeTab !== tab) setActiveTab(tab);
  };

  let projectNames = Object.keys(data);
  console.log(String(projectNames.indexOf("Learn React")))

  return (
    <div>
      <Nav tabs>
        {projectNames.map((project) => (
          <NavItem>
            <NavLink>{project({ active: activeTab === String(projectNames.indexOf("Learn React")) })}</NavLink>
          </NavItem>
        ))}
      </Nav>
    </div>
  );
};

export default MyTabPanel;
